                        subCat.products.map(item =>(
                            <>
                                {
                                    item.id === 8 ?
                                    (
                                        <>
                                            <h1>Hey</h1>
                                        </>
                                    )
                                    :
                                    undefined
                                }
                            </>
                        ))
                    }
                    </>
                ))
            }
        </>
    )
}

export default ProductView
